import React from "react";

interface Props {
  key: string;
  name: string;
  description: string;
}

const Community: React.FC<Props> = ({ key, name, description }) => {
  return (
    <React.Fragment>
      <div className="community-container" key={key}>
        <p>{name}</p>
        <p>{description}</p>
      </div>
    </React.Fragment>
  );
};

export default Community;
